namespace TestiMinPrinter.Platforms
{
    public class IminPrinterHandler : IJNIPrinter
    {
        private IminPrintUtils iminPrintUtils = null;

       


        public IminPrinterHandler()
        {

           

        }

        public bool InitializePrinter(int model)
        {
            try
            {

                var context = Android.App.Application.Context;

                iminPrintUtils = new IminPrintUtils(context);
                IminPrintUtils.PrintConnectType connectType = IminPrintUtils.PrintConnectType.Bluetooth;
                iminPrintUtils.InitPrinter(connectType);


                return true;
            }
            catch (Exception ex)
            {
              
                return false;
            }


        }

        public bool ConnectPrinter(CommunicationChannels channel, string connectionString)
        {
            try
            {
                IminPrintUtils.PrintConnectType connectType = IminPrintUtils.PrintConnectType.Bluetooth;
                int status = iminPrintUtils.GetPrinterStatus(connectType);

               

                if (BluetoothUtil.IsBluetoothOn)
                {
                    BluetoothAdapter adapter = BluetoothAdapter.DefaultAdapter;
                    BluetoothDevice device = adapter.GetRemoteDevice(connectionString);
                    BluetoothUtil.ConnectDevice(device);
                    int res = iminPrintUtils.GetPrinterStatus(connectType);
                    if (res == 0)
                    {
                        return true;
                    }

                }


                return false;
            }
            catch (Exception e)
            {
               
                return false;
            }

        }

        public bool DisconnectPrinter()
        {
            try
            {
                iminPrintUtils.DisConnectDevices();
                return true;
            }
            catch (Exception e)
            {
               
                return false;
            }


        }

        private bool AddTextFeed(PrintSDKDataObject data)
        {
            try
            {

                foreach (string dt in data.additionalparameters)
                {
                    switch (dt)
                    {
                        case "LEFT":
                            iminPrintUtils.SetAlignment(0); break;
                        case "CENTER":
                            iminPrintUtils.SetAlignment(1); break;
                        case "RIGHT":
                            iminPrintUtils.SetAlignment(2); break;
                        case "ST-BOLD":
                            iminPrintUtils.SetTextStyle(0); break;
                        case "ST-DEF":
                            iminPrintUtils.SetTextTypeface(Typeface.Default); break;
                        case "FONT-A":
                            iminPrintUtils.SetTextTypeface(Typeface.Serif); break;
                        case "FONT-B":
                            iminPrintUtils.SetTextTypeface(Typeface.SansSerif); break;
                        case "FONT-C":
                            iminPrintUtils.SetTextTypeface(Typeface.Monospace); break;
                        case "FONT-D":
                            iminPrintUtils.SetTextTypeface(Typeface.Default); break;
                        case "FONT-E":
                            iminPrintUtils.SetTextTypeface(Typeface.Default); break;
                        case "FONT-DEF":
                            iminPrintUtils.SetTextTypeface(Typeface.Default); break;
                        case "SZ-DEF":
                            iminPrintUtils.SetTextSize(28); break;
                        case "SZ-1":
                            iminPrintUtils.SetTextSize(30); break;
                        case "SZ-2":
                            iminPrintUtils.SetTextSize(32); break;
                        case "SZ-3":
                            iminPrintUtils.SetTextSize(34); break;
                        case "SZ-4":
                            iminPrintUtils.SetTextSize(36); break;
                        case "SZ-6":
                            iminPrintUtils.SetTextSize(38); break;
                        case "SZ-7":
                            iminPrintUtils.SetTextSize(40); break;
                        case "SZ-8":
                            iminPrintUtils.SetTextSize(42); break;
                        case "FONT-SMOOTH":
                            //
                            break;
                        case "FONT-NO-SMOOTH":
                            //
                            break;
                        case "FONT-SMOOTH-DEF":
                            //
                            break;
                    }
                }

                iminPrintUtils.PrintText(data.contentDetails);


                return true;

            }
            catch (Exception ex)
            {
               
                return false;
            }

        }


        public bool ProcessDocumentAndPrint(IList<PrintSDKDataObject> dataset)
        {


            try
            {
                int load = 0;
                bool lineend = true;
                iminPrintUtils.EnterPrinterBuffer(true);
                foreach (PrintSDKDataObject data in dataset)
                {

                    load++;
                    switch (data.itemType)
                    {
                        case "kreolor-logo":
                            AddKreolorLogo();
                            break;
                        case "jouel-logo":
                            AddJouelLogo();
                            break;
                        case "line-feed":
                            iminPrintUtils.PrintText("\n");
                            break;
                        case "telerik-report":
                            if (data.contentDetails.Length > 0)
                            {
                                PrintTelerikReport(data.contentDetails);
                            }

                            break;
                        case "line":
                            iminPrintUtils.PrintText("________________________________________________\n");
                            break;
                        case "text-data":
                            AddTextFeed(data);
                            if (data.contentDetails.Contains("\n"))
                            {
                                lineend = true;
                            }
                            else
                            {
                                lineend = false;
                            }
                            break;
                        case "qr-code":
                            if (data.additionalparameters.Length > 0)
                            {
                                foreach (string parameter in data.additionalparameters)
                                {
                                    switch (parameter)
                                    {
                                        case "LEFT":
                                            iminPrintUtils.SetAlignment(0); break;
                                        case "CENTER":
                                            iminPrintUtils.SetAlignment(1); break;
                                        case "RIGHT":
                                            iminPrintUtils.SetAlignment(2); break;
                                    }
                                }

                            }
                            iminPrintUtils.PrintQrCode(data.contentDetails);
                            break;

                    }
                    if (lineend && load > 3)
                    {
                        load = 0;
                        iminPrintUtils.CommitPrinterBuffer();
                        iminPrintUtils.ExitPrinterBuffer(true);
                    }

                }
                iminPrintUtils.PartialCutPaper();
                iminPrintUtils.CommitPrinterBuffer();
                iminPrintUtils.ExitPrinterBuffer(true);
                return true;


            }
            catch (Exception e)
            {
              
                return false;
            }


        }

        private bool AddJouelLogo()
        {

            //return manager.AddBase64ImageFeed("");
            iminPrintUtils.PrintSingleBitmap(Base64ToBitmap(""), 1);
            return true;
        }
        public bool AddKreolorLogo()
        {



            try
            {
                ///return manager.AddBase64ImageFeed("");
                iminPrintUtils.PrintSingleBitmap(Base64ToBitmap(""), 1);

                return true;
            }
            catch (Exception e)
            {
               
                return false;
            }
        }

        public bool PrintTelerikReport(string content)
        {

            iminPrintUtils.PrintSingleBitmap(Base64ToBitmap(content), 1);
            return true;
        }

        public int getId()
        {
            return 3;
        }

        public Bitmap Base64ToBitmap(String base64String)
        {
            byte[] imageAsBytes = Android.Util.Base64.Decode(base64String, Base64Flags.Default);
            return BitmapFactory.DecodeByteArray(imageAsBytes, 0, imageAsBytes.Length);
        }

    }
}
